import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AdminRegister from './components/AdminRegister';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/adminRegister' element={<AdminRegister />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
